sys_variable_value.value:
(function execute(inputs, outputs) {

    var omnyDateStr = inputs.omny_date_time_string;
    var gdt = new GlideDateTime();

    if (omnyDateStr) {
        var gdtStr = omnyDateStr.toString().replace('T', ' ').replace('Z', '');
        gdt.setValue(gdtStr);
    }

    outputs.glide_date_time = gdt;
    outputs.date_time_display_value = gdt.getDisplayValue();
    outputs.date_time_value = gdt.getValue();


})(inputs, outputs);

